column89:
This patch provides three components required to implement XEP-0184:

 * DeliveryReceiptRequest is a PacketExtension to request a receipt
 * DeliveryReceipt is a PacketExtension that contains the receipt
 * DeliveryReceiptProvider generates DeliveryReceipt's from the stream

Implementation:

For requesting a receipt, just add a new DeliveryReceiptRequest() to
your message.

To answer a receipt request, you need to register the Provider first:

	providermanager.addExtensionProvider("received",
		DeliveryReceipt.NAMESPACE,
		new DeliveryReceiptProvider());

Then, you can check if a received message contains a request:

	if (msg.getExtension("request", DeliveryReceipt.NAMESPACE) != null) {
		Message ack = new Message(msg.getFrom(), Message.Type.normal);
		ack.addExtension(new DeliveryReceipt(msg.getPacketID()));
		xmppconnection.sendPacket(ack);
	}

Do not forget to add the feature to your ServiceDiscoveryManager, and to
handle incoming receipts in your PacketListener!

This fixes #429

Step to reproduce:

```js
{
    "require": {
        "composer/composer": "dev-master"
    }
}
```

Install the deps with composer.

Then change the composer.json file to

```js
{
    "require": {
        "composer/composer": "dev-git_change_url"
    },
    "repositories": [
        {
            "type": "vcs",
            "url": "git://github.com/stof/composer.git"
        }
    ]
}
```

and run the update command with composer.

With the phar, this will fail as it tries to checkout a commit that is not part of the ``composer/composer`` repo which is the remote.
with my commit, it changes the remote url to ``stof/composer`` before fetching, thus finding the commit.

Note: the actual fix is small. Most of the changes are there to apply the protocol-switching in the update as well:

```diff
diff --git a/src/Composer/Downloader/GitDownloader.php b/src/Composer/Downloader/GitDownloader.php
index 0aa043c..45a3437 100644
--- a/src/Composer/Downloader/GitDownloader.php
+++ b/src/Composer/Downloader/GitDownloader.php
@@ -57,7 +57,7 @@ class GitDownloader extends VcsDownloader
         $ref = escapeshellarg($target->getSourceReference());
         $path = escapeshellarg($path);
         $this->io->write("    Checking out ".$target->getSourceReference());
-        $command = sprintf('cd %s && git fetch && git checkout %2$s && git reset --hard %2$s', $path, $ref);
+        $command = sprintf('cd %s && git remote set-url origin %s && git fetch && git checkout %3$s && git reset --hard %3$s', $path, $target->getSourceUrl(), $ref);
         if (0 !== $this->process->execute($command, $ignoredOutput)) {
             throw new \RuntimeException('Failed to execute ' . $command . "\n\n" . $this->process->getErrorOutput());
         }
```

- Fixed one memory leak;
- Fixed one Xcode warning;
- Added ability to specify shadow color, shadow offset and shadow blur;
